// HasConsumerAgent applies the HasEdge predicate on the "consumer_agent" edge.
func HasConsumerAgent() predicate.LLMToolResolution {
	return predicate.LLMToolResolution(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, ConsumerAgentTable, ConsumerAgentColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasConsumerAgentWith applies the HasEdge predicate on the "consumer_agent" edge with a given conditions (other predicates).
func HasConsumerAgentWith(preds ...predicate.Agent) predicate.LLMToolResolution {
	return predicate.LLMToolResolution(func(s *sql.Selector) {
		step := newConsumerAgentStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

